import { useEffect, useState } from "react";
import { useParams } from "react-router";
import CabeceraH1 from "../components/CabeceraH1"
import { Link } from 'react-router-dom'
import FichaObject from '../components/FichaObject'

export default function ListadoObjetos (props)
{
  const FILTROS = {
    jorvik: `jorvik`,
    licencias: `licencias`,
    packs: `packs`,
    diarios: `tools`,
    items: `items`,
    all: `all`
  }
    const params =FILTROS[useParams().filtro]
    const callAPI = async (params) => {
    await fetch( `http://localhost:9000/objetos/${params}` )
      .then( res => res.json() )
      .then( res => setRecetas(res) );
      
    }
    
    const [ recetas, setRecetas ] = useState( [] )

    useEffect(() => {
      callAPI(params)
    }, [params])
  
    console.log(useParams());
    return (
      <>
            <div>
            
                <main>
                    <CabeceraH1 clase={`bg-header-olinka`} titulo={`Jorvik MOD`} subtitulo={`Incluido en el Olinka MOD Pack`}></CabeceraH1>
                   
                    <div className="center_block clear_down">
                        <p>El Pack Jorvik MOD incluye todos los edificios y objetos crafteables que puedes encontrar en su pack pr√≥pio desde su web oficial: <a href="https://jorvikmod.com/" target={`_blank`}>https://jorvikmod.com/</a> </p>
                        <h2>Listado de objetos</h2>
                    </div>
                    
                <div className="object-list">
              
              {      
                
                        recetas.map( ( e,k ) =>
                        {
                            return (
                                <>
                                    <FichaObject e={e} k={k}></FichaObject>
                                </>
                            )
                        }
                        )
                        
                    }
                        
                </div>
                    <div className="center_block">
                        <hr />
                        <ul className="destacados">
                            <li><Link to="/life-is-feudal/olinka-mod/jorvik">Objetos del Jorvik MOD</Link></li>
                            <li><Link to="/life-is-feudal/olinka-mod/diarios">Los Diarios de Encargos</Link></li>
                            <li><Link to="/life-is-feudal/olinka-mod/licencias">Licencias de obra</Link></li>
                            <li><Link to="/life-is-feudal/olinka-mod/items">Objetos especiales del MOD</Link></li>
                            <li><Link to="/life-is-feudal/olinka-mod/packs">Packs para generar monedas</Link></li>
                        </ul>
                    </div>
                </main>
            </div>
        </>
    )

}
